import React from 'react';
import '../CSS/result.css'

class Result extends React.Component {
        constructor(props) {
            super(props);
            this.state = {
                data: props.data,
            };
            this.handleData = this.handleData.bind(this);
        }

        componentWillReceiveProps(props) {
            this.setState({ data: props.data });
        }

        handleData(name) {
                if (!(name in this.state.data)) return;
                let res = [];
                let data = this.state.data[name];
                for (let i in data) res.push( < tr > { i }, { data[i] } < /tr>);
                    return res;
                }

                other(items) {
                        let ser = 0;
                        let res = [],
                            temp = [];
                        for (let i of items) {
                            if (ser % 3 === 0) {
                                res.push( < tr > {
                                        [...temp]
                                    } < /tr>);
                                    temp = []; ser = 0;
                                }
                                temp.push( < td > { i } < /td>);
                                    ser++;
                                }
                                return res;
                            }

                            render() {
                                return ( < div className = 'result' >
                                    <
                                    h1 className = 'title' > 结果 < /h1> <
                                    table className = 'resultTable' >
                                    <
                                    tbody >
                                    <
                                    tr >
                                    <
                                    th colSpan = { 2 } > 基本信息 < /th> <
                                    td > { this.state.data.basic } < /td> < /
                                    tr > <
                                    /tbody> <
                                    tbody >
                                    <
                                    tr colSpan = { 3 } > < th > 学术能力 < /th></tr > { this.handleData('Academic') } <
                                    tr colSpan = { 3 } > < th > 社交能力 < /th></tr > { this.handleData('Social') } <
                                    tr colSpan = { 3 } > < th > 一般能力 < /th></tr > { this.handleData('Normal') } <
                                    /tbody> < /
                                    table > <
                                    img src = { require('./image/1.png') }
                                    /> < /
                                    div > );
                            }
                        }
                        /*

                        */

                        export default Result;
